import React from "react";

const Mission = () =>{
    return(
        <section className="mission">
        <div className="container">
            <div className="row">
                <div className="col-12">
                <h4>Our Mission</h4>
                <h3>Enhance The Quality Of Our Farmer Life</h3>
                <p></p>

                </div>
            </div>
        </div>

        </section>

    )
}

export default Mission;
